import React from "react";
import { BrowserRouter, NavLink } from "react-router-dom";

export default function Footer() {
  return (
    <>
      <div id="manfooter">
        <BrowserRouter>
          <NavLink to="/About">About</NavLink>
        </BrowserRouter>
      </div>
    </>
  );
}
